    "2015-08-21T22:48:25.944727",nt"name": "spinal-cord-dysfunction-scd",nt"isopen":
    true,nt"url": null,nt"notes": "The Spinal Cord Dysfunction (SCD) module
    supports the maintenance of local and national registries for the tracking of patients
    with spinal cord injury and disease from both traumatic and non-traumatic causes.
    SCD includes features for clinical, management, and research staff. Clinicians benefit
    from the ability to see profiles of SCD patients, ensure that regular annual exams
    are completed, and measure patient outcomes. Managers have a suite of reports that
    reflect the resources needed to care for SCD patients. Researchers have access to
    a national registry for all Veteran SCD patients and their associated health care
